import React from "react";
import "./account.css";
import 'antd/dist/antd.css'; // or 'antd/dist/antd.less'
import { Button, Form, Input,Select} from 'antd';

function Account() {
  return (
    <div>
        <Form
            name="wrap"
            labelCol={{
            flex: '110px',
            }}
            labelAlign="left"
            labelWrap
            wrapperCol={{
            flex: 1,
            }}
            colon={false}
            className="account-wrapper"
        >
            <Form.Item
                label="正常标签文案"
                name="username"
                rules={[
                    {
                    required: true,
                    },
                ]}
            >
                <Input />
            </Form.Item>

            <Form.Item
                label="超长标签文案超长标签文案"
                name="password"
                rules={[
                    {
                    required: true,
                    },
                ]}
            >
            <Input />
            </Form.Item>
                <Form.Item label=" ">
                <Button type="primary" htmlType="submit">
                    Submit
                </Button>
            </Form.Item>
        </Form>
    </div>
  )
}

export default Account
